arguments.schema:
{
  "type": "object",
  "properties": {
    "id": {
      "type": "string",
      "format": "uuid",
      "description": "Member's unique identifier"
    },
    "name": {
      "type": "string",
      "description": "Member's name"
    },
    "email": {
      "type": "string",
      "format": "email",
      "description": "Member's email address"
    },
    "age": {
      "type": "number",
      "minimum": 20,
      "exclusiveMaximum": 100,
      "description": "Member's age (must be at least 20 and less than 100)"
    },
    "hobbies": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "id": {
            "type": "string",
            "format": "uuid",
            "description": "Unique identifier for the hobby"
          },
          "name": {
            "type": "string",
            "description": "Name of the hobby"
          }
        },
        "required": ["id", "name"]
      },
      "description": "Array of member's hobbies"
    },
    "created_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member record was created"
    },
    "updated_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member record was last updated"
    },
    "deleted_at": {
      "oneOf": [
        {
          "type": "null"
        },
        {
          "type": "string",
          "format": "date-time"
        }
      ],
      "description": "Timestamp when the member record was deleted, or null if not deleted"
    }
  },
  "required": ["id", "name", "email", "age", "hobbies", "created_at", "updated_at", "deleted_at"],
  "title": "IMember",
  "description": "Represents a member with their personal information, hobbies, and record timestamps"
}

